function closeMenu(){popupMenuButton.style="display:none"}function expandMenu(){popupMenuButton.style="display:flex"}function fallbackCopyTextToClipboard(n){var t=document.createElement("textarea"),i,r;t.value=n;t.style.top="0";t.style.left="0";t.style.position="fixed";document.body.appendChild(t);t.focus();t.select();try{i=document.execCommand("copy");r=i?"successful":"unsuccessful";console.log("Fallback: Copying text command was "+r)}catch(u){console.error("Fallback: Oops, unable to copy",u)}document.body.removeChild(t)}function copyTextToClipboard(n){if(!navigator.clipboard){fallbackCopyTextToClipboard(n);return}navigator.clipboard.writeText(n).then(function(){console.log("Async: Copying to clipboard was successful!")},function(n){console.error("Async: Could not copy text: ",n)})}const popupMenuButton=document.getElementById("vnb__popup"),collapseMenuButton=document.getElementById("collapse"),closeMenuButton=document.getElementById("vnb__popup__top__close-button__image");collapseMenuButton.addEventListener("click",expandMenu);closeMenuButton.addEventListener("click",closeMenu);